INSERT INTO `dkp_widgetkit` (`id`, `name`, `type`, `data`) VALUES
(1, 'Banner-ppal', 'custom', '{\"_widget\":{\"name\":\"slideshow\",\"data\":{\"nav\":\"thumbnails\",\"nav_overlay\":true,\"nav_align\":\"right\",\"thumbnail_width\":\"70\",\"thumbnail_height\":\"70\",\"thumbnail_alt\":false,\"slidenav\":\"none\",\"nav_contrast\":true,\"animation\":\"fade\",\"slices\":\"15\",\"duration\":\"500\",\"autoplay\":true,\"interval\":\"7000\",\"autoplay_pause\":false,\"kenburns\":true,\"kenburns_animation\":\"\",\"kenburns_duration\":\"15\",\"fullscreen\":false,\"min_height\":\"300\",\"media\":true,\"image_width\":\"auto\",\"image_height\":\"auto\",\"overlay\":\"middle-left\",\"overlay_animation\":\"fade\",\"overlay_background\":false,\"link_media\":true,\"title\":true,\"content\":true,\"title_size\":\"h3\",\"content_size\":\"h1\",\"link\":false,\"link_style\":\"button\",\"link_text\":\"Read more\",\"badge\":true,\"badge_style\":\"badge\",\"link_target\":true,\"class\":\"banner-ppal\"}},\"items\":[{\"title\":\"Drywall\",\"media\":\"wp-content\\/uploads\\/2018\\/09\\/drywall.jpg\",\"width\":1920,\"height\":719,\"options\":{\"media\":{\"width\":1700,\"height\":450,\"type\":\"image\"},\"media2\":{\"width\":156,\"height\":156,\"type\":\"image\"}},\"media2\":\"wp-content\\/uploads\\/2018\\/06\\/thumbnail-El-Romero.jpg\",\"content\":\"<legend>\\nEjecutamos todo tipo de tabiques y cielos a estructuras con perfiles galvanizados de calibres 25 hasta 14, pasando por soluciones normales hasta aplicaciones con caracter\\u00edsticas ac\\u00fasticas, t\\u00e9rmicas y de resistencias al fuego.  \\n<\\/legend>\\n\",\"link\":\"http:\\/\\/cielpanel.com\\/it\\/que-hacemos\\/interior\\/\"},{\"title\":\"Cielos Ac\\u00fasticos\",\"media\":\"wp-content\\/uploads\\/2018\\/09\\/cielos-acusticos.jpg\",\"width\":1920,\"height\":719,\"media2\":\"wp-content\\/uploads\\/2018\\/06\\/thumbnail-La-Esperanza.jpg\",\"options\":{\"media\":{\"width\":1700,\"height\":450,\"type\":\"image\"},\"media2\":{\"width\":156,\"height\":156,\"type\":\"image\"}},\"content\":\"<legend>\\nInstalaci\\u00f3n de cielos estructurados con perfiler\\u00edas t\\u00edpicas galvanizadas o soluciones especiales colgantes seg\\u00fan fabricante, con placas perforadas con caracter\\u00edsticas de absorbentes ac\\u00fasticos.   \\n<\\/legend>\\n\",\"link\":\"http:\\/\\/cielpanel.com\\/it\\/que-hacemos\\/interior\\/\"},{\"title\":\"Estructuras Fachadas\",\"media\":\"wp-content\\/uploads\\/2018\\/09\\/fachadas.jpg\",\"width\":1920,\"height\":719,\"options\":{\"media\":{\"width\":1700,\"height\":450,\"type\":\"image\"},\"media2\":{\"width\":156,\"height\":156,\"type\":\"image\"}},\"media2\":\"wp-content\\/uploads\\/2018\\/06\\/thumbnail-Marchigue.jpg\",\"content\":\"<legend>\\nDise\\u00f1o e instalaci\\u00f3n de estructuras met\\u00e1licas livianas galvanizadas para fachadas con objeto de recibir revestimientos livianos como Eifs, placas de exteriores y todo tipo de revestimientos met\\u00e1licos.   \\n<\\/legend>\\n\",\"link\":\"http:\\/\\/cielpanel.com\\/it\\/que-hacemos\\/exterior\\/\"}],\"random\":0,\"parse_shortcodes\":1,\"_fields\":[]}'),
